Again, nothing new here. If you have some experience with programming you already recognize this type. In Bleach, the str type represents an indexed-sequence of characters (a string), typically used to store and manipulate text. Some examples of literal values of this type: "I am a string";
""; // The empty string.
"123"; // This is a string, not a value of type "num". There are some aspects of this type that might differ from what you have seen in the previous languages you have worked with. Thus, I think it's a good idea to explain such aspects in more details: It's a sequence type. This means that value of the str type can be indexed. Indexing allows you to access individual characters from the value (which, in Bleach, are also values of type str). In Bleach, literals values of this type are always enclosed by double quotes. Finally, this type has the following methods associated with it (None of them have been implemented yet) : clear: Returns nil. This method cleans the contents from the value of str type. This change is made in-place. empty: Returns a bool value that signals whether the str value is empty or not. find: Returns a num value that identifies the index where there is the first occurrence of a provided substring (a value of type str) inside another value of type str. If the provided substring doesn't appear, the method returns -1. length: Returns a num value that represents the number of characters in the str value. pop_back: Returns a str value. This method removes the last character from the str value. push_back: Returns nil. This method adds another value of type str at the end of the str value. size: Returns a num value that represents the number of characters in the str value. substr: Returns a value of type str which is the substring of another value of type str. Such method expects two indexes (left, right), both of which are inclusive.

