In Bleach, a single-line comment starts with two slashes (//), and the comment continues until the end of the line, just like the example below: // Here you can put some extra information that the person reading your code might find useful. For comments that extend beyond a single line, you’ll need to include // on each line, like this: // This is the beginning of what it's going to be a very long comment.
// Instead of making the user go all the way to the end of the line above
// we can divide comments in different lines. However, always needing to use
// // character seems to be very cumbersome. Remember that comments can also be placed at the end of lines containing code: let x = 123.45; // It's allowed to put a comment after a line of code. However, Bleach, as Rust, recommends that the comment should appear on a separate line above the code it’s annotating: // The variable below holds an approximate value of the constant Pi.
let pi = 3.14159;

